import { Header } from '../HeaderComponent/Header';
import { Hobbies } from '../HobbiesComponent/Hobbies';
import { Skills } from '../SkillsComponent/Skills';
import './UserBox.css';


interface ISkills{
    "id": number;
    "skill": string;
}

interface IHobbies{
    "id": number;
    "skill": string;
}

interface IUserData{
    "name": string;
    "fullName": string;
    "qualification": string;
    "skills": ISkills[];
    "hobbies": IHobbies[];
}


export const UserBox = ({userData}: any) => {

    console.log(userData);

    const {name, fullName, qualification, skill, hobbies} = userData;

    console.log(name);

    return (
        <div className='mainBox'>
            <Header />
            <div className="contentBox">
                <Skills />
                <Hobbies />
            </div>
        </div>
    )
}
